n\n            type: object\n          style: deepObject\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: Apis\n                description: A list of Api versions for the given apiID\n                items:\n                  $ref: \"#/components/schemas/Api\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n    put:\n      summary: Upsert an Api\n      description: |-\n        Upsert an Api. If the Api does not exist, it will be created.\n        If the Api exists, it will be updated.\n      operationId: upsertApi\n      parameters:\n        - description: The ID of the Api to upsert.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: A JSON representation of the Api to upsert\n        content:\n          application/json:\n            schema:\n              $ref: \"#/components/schemas/Api\"\n        required: true\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/Api\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/api_endpoints:\n    get:\n      summary: Get all Api endpoints for a particular apiID.\n      operationId: getAllApiEndpoints\n      parameters:\n        - description: The ID of the Api to retrieve ApiEndpoints for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: ApiEndpoints\n                items:\n                  $ref: \"#/components/schemas/ApiEndpoint\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}:\n    delete:\n      summary: Delete an Api.\n      description: |-\n        Delete a particular version of an Api. The will also delete all associated ApiEndpoints, Metadata, Schemas \u0026 Request Logs (if using a Postgres datastore).\n      operationId: deleteApi\n      parameters:\n        - description: The ID of the Api to delete.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints:\n    get:\n      summary: Get all ApiEndpoints for a particular apiID and versionID.\n      operationId: getAllForVersionApiEndpoints\n      parameters:\n        - description: The ID of the Api to retrieve ApiEndpoints for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to retrieve ApiEndpoints for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: APIEndpoints\n                items:\n                  $ref: \"#/components/schemas/ApiEndpoint\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{api      type: string\n        - description: The ID of the ApiEndpoint to upsert.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: A JSON representation of the ApiEndpoint to upsert.\n        content:\n          application/json:\n            schema:\n              $ref: \"#/components/schemas/ApiEndpoint\"\n        required: true\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/ApiEndpoint\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints/{apiEndpointID}/generate/openapi:\n    get:\n      summary: Generate an OpenAPI specification for a particular ApiEndpoint.\n      description: |-\n        This endpoint will generate a new operation in any registered OpenAPI document if the operation does not already exist in the document.\n        Returns the original document and the newly generated document allowing a diff to be performed to see what has changed.\n      operationId: generateOpenApiSpecForApiEndpoint\n      parameters:\n        - description: The ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to generate an OpenAPI specification for.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/GenerateOpenApiSpecDiff\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints/{apiEndpointID}/generate/postman:\n    get:\n      summary: Generate a Postman collection for a particular ApiEndpoint.\n      description: |-\n        Generates a postman collection that allows the endpoint to be called from postman variables produced for any path/query/header parameters included in the OpenAPI document.\n      operationId: generatePostmanCollectionForApiEndpoint\n      parameters:\n        - description: The ID of the Api to generate a Postman collection for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate a Postman collection for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to generate a Postman collection for.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/octet-stream:\n              schema:\n                format: binary\n                title: PostmanCollection\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/generate/openapi:\n    get:\n      summary: Generate an OpenAPI specification for a particular Api.\n      description: |-\n        This endpoint will generate any missing operations in any registered OpenAPI document if the operation does not already exist in the document.\n        Returns the original document and the newly generated document allowing a diff to be performed to see what has changed.\n      operationId: generateOpenApiSpec\n      parameters:\n        - description: The ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/GenerateOpenApiSpecDiff\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/version/{versionID}/generate/postman:\n    get:\n      summary: Generate a Postman collection for a particular Api.\n      description: |-\n        Generates a postman collection containing all endpoints for a particular API. Includes variables produced for any path/query/header parameters included in the OpenAPI document.\n      operationId: generatePostmanCollection\n      parameters:\n        - description: The ID of the Api to generate a Postman collection for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate a Postman collection for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/octet-stream:\n              schema:\n                format: binary\n                title: PostmanCollection\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/version/{versionID}/metadata:\n    get:\n      summary: Get all metadata for a particular apiID and versionID.\n      operationId: getVersionMetadata\n      parameters:\n        - description: The ID of the Api to retrieve metadata for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to retrieve metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: VersionMetadata\n                items:\n                  $ref: \"#/components/schemas/VersionMetadata\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Metadata\n    post:\n      summary: Insert metadata for a particular apiID and versionID.\n      operationId: insertVersionMetadata\n      parameters:\n        - description: The ID of the Api to insert metadata for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to insert metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: A JSON representation of the metadata to insert.\n        content:\n          application/json:\n            schema:\n              $ref: \"#/components/schemas/VersionMetadata\"\n        required: true\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/VersionMetadata\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Metadata\n  /v1/apis/{apiID}/version/{versionID}/metadata/{metaKey}/{metaValue}:\n    delete:\n      summary: Delete metadata for a particular apiID and versionID.\n      operationId: deleteVersionMetadata\n      parameters:\n        - description: The ID of the Api to delete metadata for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The key of the metadata to delete.\n          in: path\n          name: metaKey\n          required: true\n          schema:\n            type: string\n        - description: The value of the metadata to delete.\n          in: path\n          name: metaValue\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Metadata\n  /v1/apis/{apiID}/version/{versionID}/schema:\n    get:\n      summary: Get information about the latest schema.\n      description: |-\n        Returns information about the last uploaded schema for a particular API version. \n        This won't include the schema itself, that can be retrieved via the downloadSchema operation.\n      operationId: getSchema\n      parameters:\n        - description: The ID of the Api to get the schema for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/Schema\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n    post:\n      summary: Register a schema.\n      description: |-\n        Allows uploading a schema for a particular API version.\n        This will be used to populate ApiEndpoints and used as a base for any schema generation if present.\n      operationId: registerSchema\n      parameters:\n        - description: The ID of the Api to get the schema for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: The schema file to upload provided as a multipart/form-data file segment.\n        content:\n          multipart/form-data:\n            schema:\n              properties:\n                file:\n                  format: binary\n                  type: string\n              required:\n                - file\n              type: object\n        required: true\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n  /v1/apis/{apiID}/version/{versionID}/schema/download:\n    get:\n      summary: Download the latest schema for a particular apiID.\n      operationId: downloadSchema\n      parameters:\n        - description: The ID of the Api to download the schema for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                format: binary\n                title: Schema\n                type: string\n            application/x-yaml:\n              schema:\n                format: binary\n                title: Schema\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n  /v1/apis/{apiID}/version/{versionID}/schema/{baseRevisionID}/diff/{targetRevisionID}:\n    get:\n      summary: Get a diff of two schema revisions for an Api.\n      operationId: getSchemaDiff\n      parameters:\n        - description: The ID of the Api to retrieve schemas for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The base revision ID of the schema to retrieve.\n          in: path\n          name: baseRevisionID\n          required: true\n          schema:\n            type: string\n        - description: The target revision ID of the schema to retrieve.\n          in: path\n          name: targetRevisionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/SchemaDiff\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n  /v1/apis/{apiID}/version/{versionID}/schema/{revisionID}:\n    delete:\n      summary: Delete a particular schema revision for an Api.\n      operationId: deleteSchema\n      parameters:\n        - description: The ID of the Api to delete schemas for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The revision ID of the schema to delete.\n          in: path\n          name: revisionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n    get:\n      summary: Get information about a particular schema revision for an Api.\n      description: |-\n        Returns information about the last uploaded schema for a particular schema revision. \n        This won't include the schema itself, that can be retrieved via the downloadSchema operation.\n      operationId: getSchemaRevision\n      parameters:\n        - description: The ID of the Api to retrieve schemas for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The revision ID of the schema to retrieve.\n          in: path\n          name: revisionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/Schema\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n  /v1/apis/{apiID}/version/{versionID}/schema/{revisionID}/download:\n    get:\n      summary: Download a particular schema revision for an Api.\n      operationId: downloadSchemaRevision\n      parameters:\n        - description: The ID of the Api to retrieve schemas for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The revision ID of the schema to retrieve.\n          in: path\n          name: revisionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                format: binary\n                title: Schema\n                type: string\n            application/x-yaml:\n              schema:\n                format: binary\n                title: Schema\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n  /v1/apis/{apiID}/version/{versionID}/schemas:\n    get:\n      summary: Get information about all schemas associated with a particular apiID.\n      description: |-\n        Returns information the schemas associated with a particular apiID. \n        This won't include the schemas themselves, they can be retrieved via the downloadSchema operation.\n      operationId: getSchemas\n      parameters:\n        - description: The ID of the Api to retrieve schemas for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                items:\n                  $ref: \"#/components/schemas/Schema\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Schemas\n  /v1/auth/validate:\n    get:\n      summary: Validate the current api key.\n      operationId: validateApiKey\n      tags:\n        - Auth\n      responses:\n        \"200\":\n          description: OK\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/ApiKeyDetails\"\n        default:\n          $ref: \"#/components/responses/default\"\n  /v1/auth/access_token:\n    get:\n      summary: Get or refresh an access token for the current workspace.\n      security: [{}]\n      operationId: getAccessToken\n      tags:\n        - Auth\n      parameters:\n        - description: The workspace ID\n          in: query\n          name: workspace_id\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/AccessToken\"\n        default:\n          $ref: \"#/components/responses/default\"\n  /v1/eventlog/query:\n    get:\n      summary: Query the event log to retrieve a list of requests.\n      description: |-\n        Supports retrieving a list of request captured by the SDK for this workspace.\n        Allows the filtering of requests on a number of criteria such as ApiID, VersionID, Path, Method, etc.\n      operationId: queryEventLog\n      parameters:\n        - content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/Filters\"\n          description: The filter to apply to the query.\n          in: query\n          name: filters\n          required: false\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: BoundedRequests\n                items:\n                  $ref: \"#/components/schemas/BoundedRequest\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Requests\n  /v1/eventlog/{requestID}:\n    get:\n      summary: Get information about a particular request.\n      operationId: getRequestFromEventLog\n      parameters:\n        - description: The ID of the request to retrieve.\n          in: path\n          name: requestID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/UnboundedRequest\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Requests\n  /v1/eventlog/{requestID}/generate/postman:\n    get:\n      summary: Generate a Postman collection for a particular request.\n      description: |-\n        Generates a Postman collection for a particular request. \n        Allowing it to be replayed with the same inputs that were captured by the SDK.\n      operationId: generateRequestPostmanCollection\n      parameters:\n        - description: The ID of the request to retrieve.\n          in: path\n          name: requestID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/octet-stream:\n              schema:\n                format: binary\n                title: PostmanCollection\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Requests\n  /v1/workspace/embed-access-token:\n    get:\n      summary: Get an embed access token for the current workspace.\n      description: |-\n        Returns an embed access token for the current workspace. This can be used to authenticate access to externally embedded content.\n        Filters can be applied allowing views to be filtered to things like particular customerIds.\n      operationId: getEmbedAccessToken\n      parameters:\n        - description: The description of the embed access token.\n          in: query\n          name: description\n          required: false\n          schema:\n            type: string\n        - description: The duration (in minutes) of the embed access token.\n          in: query\n          name: duration\n          required: false\n          schema:\n            type: integer\n        - content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/Filters\"\n          description: The filter to apply to the query.\n          in: query\n          name: filters\n          required: false\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/EmbedAccessTokenResponse\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Embeds\n  /v1/workspace/embed-access-tokens/valid:\n    get:\n      summary: Get all valid embed access tokens for the current workspace.\n      operationId: getValidEmbedAccessTokens\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: EmbedTokens\n                items:\n                  $ref: \"#/components/schemas/EmbedToken\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Embeds\n  /v1/workspace/embed-access-tokens/{tokenID}:\n    delete:\n      summary: Revoke an embed access EmbedToken.\n      operationId: revokeEmbedAccessToken\n      parameters:\n        - description: The ID of the EmbedToken to revoke.\n          in: path\n          name: tokenID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Embeds\n  /v1/workspace/{workspaceID}/events:\n    parameters:\n      - name: workspaceID\n        in: path\n        required: true\n        description: Unique identifier of the workspace.\n        schema:\n          type: string\n    get:\n      description: Load recent events for a particular workspace\n      operationId: getWorkspaceEvents\n      tags:\n        - Events\n      parameters:\n        - in: query\n          name: generate_gen_lock_id\n          description: Filter to only return events corresponding to a particular gen_lock_id (gen_lock_id uniquely identifies a target)\n          required: false\n          schema:\n            type: string\n        - name: after_created_at\n          in: query\n          description: Filter to only return events created after this timestamp\n          required: false\n          schema:\n            type: string\n            format: date-time\n      responses:\n        200:\n          description: Success\n          content:\n            application/json:\n              schema:\n                $ref: '#/components/schemas/CliEventBatch'\n        5XX:\n          description: Error\n          content:\n            application/json:\n              schema:\n                $ref: '#/components/schemas/Error'\n\n    post:\n      summary: Post events for a specific workspace\n      description: Sends an array of events to be stored for a particular workspace.\n      operationId: postWorkspaceEvents\n      # Idempotent, so allow retries\n      x-speakeasy-retries:\n        strategy: backoff\n        backoff:\n          initialInterval: 100        # 100 milliseconds\n          maxInterval: 2000          # 2 seconds\n          maxElapsedTime: 30000     # 30 seconds\n          exponent: 1.5\n        statusCodes:\n          - 408\n          - 500\n          - 502\n          - 503\n        retryConnectionErrors: true\n      tags:\n        - Events\n      requestBody:\n        required: true\n        content:\n          application/json:\n            schema:\n              $ref: '#/components/schemas/CliEventBatch'\n      responses:\n        2XX:\n          description: Success\n        5XX:\n          content:\n            application/json:\n              schema:\n                $ref: '#/components/schemas/Error'\n  /v1/workspace/access:\n    get:\n      summary: Get access allowances for a particular workspace\n      description: Checks if generation is permitted for a particular run of the CLI\n      operationId: getWorkspaceAccess\n      x-speakeasy-retries:\n        strategy: backoff\n        backoff:\n          initialInterval: 100        # 100 milliseconds\n          maxInterval: 2000          # 2 seconds\n          maxElapsedTime: 30000     # 30 seconds\n          exponent: 1.5\n        statusCodes:\n          - 408\n          - 500\n          - 502\n          - 503\n        retryConnectionErrors: true\n      tags:\n        - Auth\n      parameters:\n        - name: genLockId\n          in: query\n          description: Unique identifier of the generation target.\n          schema:\n            type: string\n        - name: targetType\n          in: query\n          description: The type of the generated target.\n          schema:\n            type: string\n        - name: passive\n          in: query\n          description: Skip side-effects like incrementing metrics.\n          schema:\n            type: boolean\n      responses:\n        \"200\":\n          description: OK\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/AccessDetails\"\n  /v1/workspace/{workspaceID}/events/targets:\n    parameters:\n      - name: workspaceID\n        in: path\n        required: true\n        description: Unique identifier of the workspace.\n        schema:\n          type: string\n      - name: after_last_event_created_at\n        in: query\n        description: Filter to only return targets with events created after this timestamp\n        required: false\n        schema:\n          type: string\n          format: date-time\n    get:\n      description: Load targets for a particular workspace\n      operationId: getWorkspaceTargets\n      tags:\n        - Events\n      responses:\n        200:\n          description: Success\n          content:\n            application/json:\n              schema:\n                $ref: '#/components/schemas/TargetSDKList'\n        5XX:\n          content:\n            application/json:\n              schema:\n                $ref: '#/components/schemas/Error'\ncomponents:\n  responses:\n    default:\n      content:\n        application/json:\n          schema:\n            $ref: \"#/components/schemas/Error\"\n      description: Default error response\n  schemas:\n    ApiKeyDetails:\n      type: object\n      properties:\n        workspace_id:\n          type: string\n        generation_access_unlimited:\n          type: boolean\n        account_type:\n          type: string\n          enum:\n            - free\n            - scale-up\n            - enterprise\n      required:\n        - workspace_id\n        - account_type\n    AccessDetails:\n      type: object\n      properties:\n        generation_allowed:\n          type: boolean\n        message:\n          type: string\n      required:\n        - generation_allowed\n        - message\n    Api:\n      description: An Api is representation of a API (a collection of API Endpoints) within the Speakeasy Platform.\n      properties:\n        api_id:\n          description: The ID of this Api. This is a human-readable name (subject to change).\n          type: string\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        description:\n          description: A detailed description of the Api.\n          type: string\n        matched:\n          description: Determines if all the endpoints within the Api are found in the OpenAPI spec associated with the Api.\n          readOnly: true\n          type: boolean\n        meta_data:\n          additionalProperties:\n            items:\n              type: string\n            type: array\n          description: A set of values associated with a meta_data key. This field is only set on get requests.\n          type: object\n        updated_at:\n          description: Last update timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        version_id:\n          description: The version ID of this Api. This is semantic version identifier.\n          type: string\n        workspace_id:\n          description: The workspace ID this Api belongs to.\n          readOnly: true\n          type: string\n      required:\n        - api_id\n        - created_at\n        - description\n        - updated_at\n        - version_id\n        - workspace_id\n      type: object\n    ApiEndpoint:\n      description: An ApiEndpoint is a description of an Endpoint for an API.\n      properties:\n        api_endpoint_id:\n          description: The ID of this ApiEndpoint. This is a hash of the method and path.\n          type: string\n        api_id:\n          description: The ID of the Api this ApiEndpoint belongs to.\n          readOnly: true\n          type: string\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        description:\n          description: A detailed description of the ApiEndpoint.\n          type: string\n        display_name:\n          description: A human-readable name for the ApiEndpoint.\n          type: string\n        matched:\n          description: Determines if the endpoint was found in the OpenAPI spec associated with the parent Api.\n          readOnly: true\n          type: boolean\n        method:\n          description: HTTP verb.\n          type: string\n        path:\n          description: Path that handles this Api.\n          type: string\n        updated_at:\n          description: Last update timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        version_id:\n          description: The version ID of the Api this ApiEndpoint belongs to.\n          type: string\n        workspace_id:\n          description: The workspace ID this ApiEndpoint belongs to.\n          readOnly: true\n          type: string\n      required:\n        - api_endpoint_id\n        - api_id\n        - created_at\n        - description\n        - display_name\n        - method\n        - path\n        - updated_at\n        - version_id\n        - workspace_id\n      type: object\n    BoundedRequest:\n      description: A BoundedRequest is a request that has been logged by the Speakeasy without the contents of the request.\n      properties:\n        api_endpoint_id:\n          description: The ID of the ApiEndpoint this request was made to.\n          readOnly: true\n          type: string\n        api_id:\n          description: The ID of the Api this request was made to.\n          readOnly: true\n          type: string\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        customer_id:\n          description: The ID of the customer that made this request.\n          readOnly: true\n          type: string\n        latency:\n          description: The latency of the request.\n          readOnly: true\n          type: integer\n        method:\n          description: HTTP verb.\n          readOnly: true\n          type: string\n        path:\n          description: The path of the request.\n          readOnly: true\n          type: string\n        request_finish_time:\n          description: The time the request finished.\n          format: date-time\n          readOnly: true\n          type: string\n        request_id:\n          description: The ID of this request.\n          readOnly: true\n          type: string\n        request_start_time:\n          description: The time the request was made.\n          format: date-time\n          readOnly: true\n          type: string\n        status:\n          description: The status code of the request.\n          readOnly: true\n          type: integer\n        version_id:\n          description: The version ID of the Api this request was made to.\n          readOnly: true\n          type: string\n        workspace_id:\n          description: The workspace ID this request was made to.\n          readOnly: true\n          type: string\n        metadata:\n          description: Metadata associated with this request\n          readOnly: true\n          items:\n            $ref: \"#/components/schemas/RequestMetadata\"\n          type: array\n      required:\n        - api_endpoint_id\n        - api_id\n        - created_at\n        - customer_id\n        - latency\n        - method\n        - path\n        - request_finish_time\n        - request_id\n        - request_start_time\n        - status\n        - version_id\n        - workspace_id\n      type: object\n    RequestMetadata:\n      description: Key-Value pairs associated with a request\n      properties:\n        key:\n          type: string\n        value:\n          type: string\n      type: object\n    EmbedAccessTokenResponse:\n      description: An EmbedAccessTokenResponse contains a token that can be used to embed a Speakeasy dashboard.\n      properties:\n        access_token:\n          type: string\n      required:\n        - access_token\n      type: object\n    AccessToken:\n      description: An AccessToken is a token that can be used to authenticate with the Speakeasy API.\n      properties:\n        access_token:\n          type: string\n        claims:\n          type: object\n        user:\n          type: object\n          properties:\n            email:\n              type: string\n            id:\n              type: string\n            display_name:\n              type: string\n            admin:\n              type: boolean\n            created_at:\n              type: string\n              format: date-time\n            email_verified:\n              type: boolean\n        workspaces:\n            type: array\n            items:\n                type: object\n                properties:\n                id:\n                    type: string\n                name:\n                    type: string\n                updated_at:\n                    type: string\n                    format: date-time\n                account_type:\n                    type: string\n                    enum:\n                    - free\n                    - scale-up\n                    - enterprise\n\n      required:\n        - access_token\n        - claims\n        - user\n      type: object\n    EmbedToken:\n      description: A representation of an embed token granted for working with Speakeasy components.\n      properties:\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        created_by:\n          description: The ID of the user that created this token.\n          readOnly: true\n          type: string\n        description:\n          description: A detailed description of the EmbedToken.\n          type: string\n        expires_at:\n          description: The time this token expires.\n          format: date-time\n          readOnly: true\n          type: string\n        filters:\n          description: The filters applied to this token.\n          readOnly: true\n          type: string\n        id:\n          description: The ID of this EmbedToken.\n          readOnly: true\n          type: string\n        last_used:\n          description: The last time this token was used.\n          format: date-time\n          readOnly: true\n          type: string\n        revoked_at:\n          description: The time this token was revoked.\n          format: date-time\n          readOnly: true\n          type: string\n        revoked_by:\n          description: The ID of the user that revoked this token.\n          readOnly: true\n          type: string\n        workspace_id:\n          description: The workspace ID this token belongs to.\n          readOnly: true\n          type: string\n      required:\n        - created_by\n        - created_at\n        - description\n        - expires_at\n        - filters\n        - id\n        - workspace_id\n      type: object\n    Error:\n      description: The `Status` type defines a logical error model\n      properties:\n        message:\n          description: A developer-facing error message.\n          type: string\n        status_code:\n          description: The HTTP status code\n          format: int32\n          type: integer\n      required:\n        - message\n        - status_code\n      type: object\n    Filter:\n      description: A filter is a key-value pair that can be used to filter a list of requests.\n      properties:\n        key:\n          description: The key of the filter.\n          type: string\n        operator:\n          description: The operator of the filter.\n          type: string\n        value:\n          description: The value of the filter.\n          type: string\n      required:\n        - key\n        - value\n        - operator\n      type: object\n    Filters:\n      description: Filters are used to query requests.\n      properties:\n        filters:\n          description: A list of filters to apply to the query.\n          items:\n            $ref: \"#/components/schemas/Filter\"\n          type: array\n        limit:\n          description: The maximum number of results to return.\n          type: integer\n        offset:\n          description: The offset to start the query from.\n          type: integer\n        operator:\n          description: The operator to use when combining filters.\n          type: string\n      required:\n        - filters\n        - limit\n        - offset\n        - operator\n      type: object\n    GenerateOpenApiSpecDiff:\n      properties:\n        current_schema:\n          type: string\n        new_schema:\n          type: string\n      required:\n        - current_schema\n        - new_schema\n      type: object\n    Plugin:\n      description: A plugin is a short script that is run against ingested requests\n      properties:\n        workspace_id:\n          type: string\n        plugin_id:\n          type: string\n        title:\n          type: string\n        code:\n          type: string\n        eval_hash:\n          type: string\n        created_at:\n          type: string\n          format: date-time\n        updated_at:\n          type: string\n          format: date-time\n      required:\n        - workspace_id\n        - plugin_id\n        - title\n        - code\n      type: object\n    Schema:\n      description: A Schema represents an API schema for a particular Api and Version.\n      properties:\n        api_id:\n          description: The ID of the Api this Schema belongs to.\n          readOnly: true\n          type: string\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        description:\n          description: A detailed description of the Schema.\n          type: string\n        revision_id:\n          description: An ID referencing this particular revision of the Schema.\n          type: string\n        version_id:\n          description: The version ID of the Api this Schema belongs to.\n          readOnly: true\n          type: string\n        workspace_id:\n          description: The workspace ID this Schema belongs to.\n          readOnly: true\n          type: string\n      required:\n        - api_id\n        - created_at\n        - description\n        - revision_id\n        - version_id\n        - workspace_id\n      type: object\n    SchemaDiff:\n      description: A SchemaDiff represents a diff of two Schemas.\n      properties:\n        additions:\n          description: Holds every addition change in the diff.\n          items:\n            type: string\n          type: array\n        deletions:\n          description: Holds every deletion change in the diff.\n          items:\n            type: string\n          type: array\n        modifications:\n          additionalProperties:\n            properties:\n              From:\n                description: Represents the previous value of the element.\n                type: string\n              To:\n                description: Represents the current value of the element.\n                type: string\n            required:\n              - From\n              - To\n            title: ValueChange\n            type: object\n          description: Holds every modification change in the diff.\n          type: object\n      required:\n        - additions\n        - deletions\n        - modifications\n      type: object\n    UnboundedRequest:\n      description: An UnboundedRequest represents the HAR content capture by Speakeasy when logging a request.\n      properties:\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        har:\n          description: The HAR content of the request.\n          readOnly: true\n          type: string\n        har_size_bytes:\n          description: The size of the HAR content in bytes.\n          readOnly: true\n          type: integer\n        request_id:\n          description: The ID of this request.\n          readOnly: true\n          type: string\n        workspace_id:\n          description: The workspace ID this request was made to.\n          readOnly: true\n          type: string\n      required:\n        - created_at\n        - har\n        - har_size_bytes\n        - request_id\n        - workspace_id\n      type: object\n    VersionMetadata:\n      description: A set of keys and associated values, attached to a particular version of an Api.\n      properties:\n        api_id:\n          description: The ID of the Api this Metadata belongs to.\n          readOnly: true\n          type: string\n        created_at:\n          description: Creation timestamp.\n          format: date-time\n          readOnly: true\n          type: string\n        meta_key:\n          description: The key for this metadata.\n          type: string\n        meta_value:\n          description: One of the values for this metadata.\n          type: string\n        version_id:\n          description: The version ID of the Api this Metadata belongs to.\n          readOnly: true\n          type: string\n        workspace_id:\n          description: The workspace ID this Metadata belongs to.\n          readOnly: true\n          type: string\n      required:\n        - api_id\n        - created_at\n        - meta_key\n        - meta_value\n        - version_id\n        - workspace_id\n      type: object\n    CliEventBatch:\n      type: array\n      items:\n        $ref: '#/components/schemas/CliEvent'\n      minItems: 1\n    CliEvent:\n      type: object\n      required:\n        - id\n        - execution_id\n        - workspace_id\n        - speakeasy_api_key_name\n        - interaction_type\n        - local_started_at\n        - created_at\n        - speakeasy_version\n        - success\n      properties:\n        id:\n          type: string\n          description: Unique identifier for each event.\n        execution_id:\n          type: string\n          description: Unique identifier for each execution of the CLI.\n        workspace_id:\n          type: string\n          description: Identifier of the workspace.\n        speakeasy_api_key_name:\n          type: string\n          description: Identifier of the Speakeasy API key.\n        interaction_type:\n          type: string\n          description: Type of interaction.\n          enum:\n            - CLI_EXEC\n            - TARGET_GENERATE\n            - AUTHENTICATE\n            - QUICKSTART\n            - RUN\n            - CONFIGURE\n            - PUBLISH\n        local_started_at:\n          type: string\n          format: date-time\n          description: Timestamp when the event started, in local time.\n        local_completed_at:\n          type: string\n          format: date-time\n          description: Timestamp when the event completed, in local time.\n        created_at:\n          type: string\n          format: date-time\n          description: Timestamp when the event was created in the database.\n        speakeasy_version:\n          type: string\n          description: Version of the Speakeasy CLI.\n        success:\n          type: boolean\n          description: Indicates whether the event was successful.\n        raw_command:\n          type: string\n          description: Full CLI command.\n        duration_ms:\n          type: integer\n          description: Duration of the event in milliseconds.\n        gh_action_run_link:\n          type: string\n          description: Link to the GitHub action run.\n        gh_action_version:\n          type: string\n          description: Version of the GitHub action.\n        gh_action_organization:\n          type: string\n          description: GitHub organization of the action.\n        gh_action_repository:\n          type: string\n          description: GitHub repository of the action.\n        repo_label:\n          type: string\n          description: Label of the git repository.\n        commit_head:\n          type: string\n          description: Remote commit ID.\n        hostname:\n          type: string\n          description: Remote hostname.\n        git_user_name:\n          type: string\n          description: User's name from git configuration. (not GitHub username)\n        git_user_email:\n          type: string\n          description: User email from git configuration.\n        git_remote_default_owner:\n          type: string\n          description: Default owner for git remote.\n        git_remote_default_repo:\n          type: string\n          description: Default repository name for git remote.\n        git_relative_cwd:\n          type: string\n          description: Current working directory relative to the git root.\n        generate_target:\n          type: string\n          description: The target of the event.\n        generate_target_version:\n          type: string\n          description: The version of the target.\n        generate_gen_lock_id:\n          type: string\n          description: gen.lock ID (expected to be a uuid).\n        management_doc_checksum:\n          type: string\n          description: Checksum of the currently Rendered OpenAPI document.\n        management_doc_version:\n          type: string\n          description: Version taken from info.version field of the Rendered OpenAPI document.\n        generate_version:\n          type: string\n          description: Version of the generation logic used.\n        generate_output_tests:\n          type: boolean\n          description: Indicates whether tests were output.\n        generate_config_pre_raw:\n          type: string\n          description: Rendered configuration file (prior to generation)\n        generate_config_post_raw:\n          type: string\n          description: Rendered configuration file (post generation)\n        generate_config_pre_version:\n          type: string\n          description: The version of the customer's SDK before we generated\n        generate_config_post_version:\n            type: string\n            description: The version of the customer's SDK that we just generated\n        generate_config_pre_checksum:\n          type: string\n          description: Checksum of the configuration file (prior to generation)\n        generate_config_post_checksum:\n          type: string\n          description: Checksum of the configuration file (post generation)\n        generate_gen_lock_pre_features:\n          type: string\n          description: Features prior to generation\n        generate_gen_lock_post_features:\n          type: string\n          description: Features post generation\n        generate_gen_lock_pre_doc_version:\n          type: string\n          description: info.Version of the Previous Rendered OpenAPI document (prior to generation, via gen lock)\n        generate_gen_lock_pre_doc_checksum:\n          type: string\n          description: Checksum of the Previous Rendered OpenAPI document (prior to generation, via gen lock)\n        generate_gen_lock_pre_version:\n          type: string\n          description: Artifact version for the Previous Generation\n        generate_bump_type:\n          type: string\n          description: Bump type of the lock file (calculated semver delta, or a custom change (manual release))\n          enum:\n            - major\n            - minor\n            - patch\n            - custom\n            - none\n        generate_published:\n          type: boolean\n          description: Indicates whether the target was considered published.\n        generate_repo_url:\n          type: string\n          description: Expected Repo URL, for use in documentation generation.\n        publish_package_url:\n          type: string\n          description: URL of the published package.\n        publish_package_name:\n          type: string\n          description: Name of the published package.\n        publish_package_version:\n          type: string\n          description: Version of the published package.\n        publish_package_registry_name:\n          type: string\n          description: Name of the registry where the package was published.\n    TargetSDKList:\n      type: array\n      items:\n        $ref: '#/components/schemas/TargetSDK'\n      minItems: 1\n    TargetSDK:\n      type: object\n      required:\n        - id\n        - generate_target\n        - generate_gen_lock_id\n        - last_event_id\n        - last_event_created_at\n      properties:\n        id:\n          type: string\n          description: Unique identifier of the target the same as `generate_gen_lock_id`\n        last_event_id:\n          type: string\n          description: Unique identifier of the last event for the target\n        last_event_created_at:\n          type: string\n          format: date-time\n          description: Timestamp when the event was created in the database.\n        success:\n          type: boolean\n          description: Indicates whether the event was successful.\n        commit_head:\n          type: string\n          description: Remote commit ID.\n        git_remote_default_owner:\n          type: string\n          description: Default owner for git remote.\n        git_remote_default_repo:\n          type: string\n          description: Default repository name for git remote.\n        git_relative_cwd:\n          type: string\n          description: Current working directory relative to the git root.\n        generate_target:\n          type: string\n          description: eg `typescript`, `terraform`, `python`\n        generate_target_name:\n          type: string\n          description: The name of the target as defined by the user.\n        generate_gen_lock_id:\n          type: string\n          description: gen.lock ID (expected to be a uuid). The same as `id`. A unique identifier for the target.\n        generate_target_version:\n          type: string\n          description: The version of the Speakeasy generator for this target eg v2 of the typescript generator.\n        generate_config_post_version:\n          type: string\n          description: Version of the generated target (post generation)\n        generate_published:\n          type: boolean\n          description: Indicates whether the target was considered published.\n        gh_action_run_link:\n          type: string\n          description: Link to the GitHub action run.\n        gh_action_version:\n          type: string\n          description: Version of the GitHub action.\n        gh_action_organization:\n          type: string\n          description: GitHub organization of the action.\n        gh_action_repository:\n          type: string\n          description: GitHub repository of the action.\n        repo_label:\n          type: string\n          description: Label of the git repository.\n        hostname:\n          type: string\n          description: Remote hostname.\n        git_user_name:\n          type: string\n          description: User's name from git configuration. (not GitHub username)\n        git_user_email:\n          type: string\n          description: User email from git configuration.\n  securitySchemes:\n    APIKey:\n      description: The API Key for the workspace\n      in: header\n      name: x-api-key\n      type: apiKey\n    Bearer:\n      description: The Bearer token for the workspace\n      type: http\n      scheme: bearer\n","modifiedSpec":"openapi: 3.0.3\ninfo:\n  description: The Speakeasy API allows teams to manage common operations with\n    their APIs\n  title: Speakeasy API\n  version: 0.4.0\nservers:\n  - url: https://api.prod.speakeasyapi.dev\n    x-speakeasy-server-id: prod\nx-speakeasy-globals:\n  parameters:\n    - name: workspaceID\n      in: path\n      schema:\n        type: string\nsecurity:\n  - APIKey: [ ]\n  - Bearer: [ ]\ntags:\n  - description: REST APIs for managing Authentication\n    name: Auth\n  - description: REST APIs for managing Api entities\n    name: Apis\n  - description: REST APIs for managing ApiEndpoint entities\n    name: ApiEndpoints\n  - description: REST APIs for managing Version Metadata entities\n    name: Metadata\n  - description: REST APIs for managing Schema entities\n    name: Schemas\n  - description: REST APIs for retrieving request information\n    name: Requests\n  - description: REST APIs for managing embeds\n    name: Embeds\n  - description: REST APIs for capturing event data\n    name: Events\nexternalDocs:\n  url: /docs\n  description: The Speakeasy Platform Documentation\npaths:\n  /v1/apis:\n    get:\n      summary: Get a list of Apis for a given workspace\n      description: |-\n        Get a list of all Apis and their versions for a given workspace.\n        Supports filtering the APIs based on metadata attributes.\n      operationId: getApis\n      x-speakeasy-usage-example: true\n      parameters:\n        - description: Configuration for filter operations changed\n          explode: true\n          in: query\n          name: op\n          required: false\n          schema:\n            properties:\n              and:\n                description: Whether to AND or OR the filters\n                type: boolean\n            required:\n              - and\n            type: object\n          style: deepObject\n        - description: Metadata to filter Apis on\n          explode: true\n          in: query\n          name: metadata\n          schema:\n            additionalProperties:\n              items:\n                type: string\n              type: array\n            description: Map of metadata key/values to filter on\n            type: object\n          style: deepObject\n        - description: Metadata to filter Apis on\n          explode: true\n          in: query\n          name: metadata2\n          schema:\n            additionalProperties:\n              items:\n                type: string\n              type: array\n            description: Map of metadata key/values to filter on\n            type: object\n          style: deepObject\n      responses:\n        \"200\":\n          content:\n            application/json:\n              x-speakeasy-usage-example: true\n              schema:\n                title: Apis\n                description: A list of Apis for the given workspace\n                items:\n                  $ref: \"#/components/schemas/Api\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}:\n    get:\n      summary: Get all Api versions for a particular ApiEndpoint.\n      description: |-\n        Get all Api versions for a particular ApiEndpoint.\n        Supports filtering the versions based on metadata attributes.\n      operationId: getAllApiVersions\n      parameters:\n        - description: The ID of the Api to retrieve.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: Configuration for filter operations\n          explode: true\n          in: query\n          name: op\n          schema:\n            properties:\n              and:\n                description: Whether to AND or OR the filters\n                type: boolean\n            required:\n              - and\n            type: object\n          style: deepObject\n        - description: Metadata to filter Apis on\n          explode: true\n          in: query\n          name: metadata\n          schema:\n            additionalProperties:\n              items:\n                type: string\n              type: array\n            description: Map of metadata key/values to filter on\n            type: object\n          style: deepObject\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: Apis\n                description: A list of Api versions for the given apiID\n                items:\n                  $ref: \"#/components/schemas/Api\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n    put:\n      summary: Upsert an Api\n      description: |-\n        Upsert an Api. If the Api does not exist, it will be created.\n        If the Api exists, it will be updated.\n      operationId: upsertApi\n      parameters:\n        - description: The ID of the Api to upsert.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: A JSON representation of the Api to upsert\n        content:\n          application/json:\n            schema:\n              $ref: \"#/components/schemas/Api\"\n        required: true\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/Api\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/api_endpoints:\n    get:\n      summary: Get all Api endpoints for a particular apiID.\n      operationId: getAllApiEndpoints\n      parameters:\n        - description: The ID of the Api to retrieve ApiEndpoints for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: ApiEndpoints\n                items:\n                  $ref: \"#/components/schemas/ApiEndpoint\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}:\n    delete:\n      summary: Delete an Api.\n      description: |-\n        Delete a particular version of an Api. The will also delete all associated ApiEndpoints, Metadata, Schemas \u0026 Request Logs (if using a Postgres datastore).\n      operationId: deleteApi\n      parameters:\n        - description: The ID of the Api to delete.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to delete.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints:\n    get:\n      summary: Get all ApiEndpoints for a particular apiID and versionID.\n      operationId: getAllForVersionApiEndpoints\n      parameters:\n        - description: The ID of the Api to retrieve ApiEndpoints for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to retrieve ApiEndpoints for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: APIEndpoints\n                items:\n                  $ref: \"#/components/schemas/ApiEndpoint\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints/find/{displayName}:\n    get:\n      summary: Find an ApiEndpoint via its displayName.\n      description: |-\n        Find an ApiEndpoint via its displayName (set by operationId from a registered OpenAPI schema).\n        This is useful for finding the ID of an ApiEndpoint to use in the /v1/apis/{apiID}/version/{versionID}/api_endpoints/{apiEndpointID} endpoints.\n      operationId: findApiEndpoint\n      parameters:\n        - description: The ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The displayName of the ApiEndpoint to find (set by operationId from OpenAPI schema).\n          in: path\n          name: displayName\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/ApiEndpoint\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints/{apiEndpointID}:\n    delete:\n      summary: Delete an ApiEndpoint.\n      description: |-\n        Delete an ApiEndpoint. This will also delete all associated Request Logs (if using a Postgres datastore).\n      operationId: deleteApiEndpoint\n      parameters:\n        - description: The ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to delete.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n    get:\n      summary: Get an ApiEndpoint.\n      operationId: getApiEndpoint\n      parameters:\n        - description: The ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to retrieve.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/ApiEndpoint\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n    put:\n      summary: Upsert an ApiEndpoint.\n      description: |-\n        Upsert an ApiEndpoint. If the ApiEndpoint does not exist it will be created, otherwise it will be updated.\n      operationId: upsertApiEndpoint\n      parameters:\n        - description: The ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api the ApiEndpoint belongs to.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to upsert.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: A JSON representation of the ApiEndpoint to upsert.\n        content:\n          application/json:\n            schema:\n              $ref: \"#/components/schemas/ApiEndpoint\"\n        required: true\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/ApiEndpoint\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints/{apiEndpointID}/generate/openapi:\n    get:\n      summary: Generate an OpenAPI specification for a particular ApiEndpoint.\n      description: |-\n        This endpoint will generate a new operation in any registered OpenAPI document if the operation does not already exist in the document.\n        Returns the original document and the newly generated document allowing a diff to be performed to see what has changed.\n      operationId: generateOpenApiSpecForApiEndpoint\n      parameters:\n        - description: The ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to generate an OpenAPI specification for.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/GenerateOpenApiSpecDiff\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/api_endpoints/{apiEndpointID}/generate/postman:\n    get:\n      summary: Generate a Postman collection for a particular ApiEndpoint.\n      description: |-\n        Generates a postman collection that allows the endpoint to be called from postman variables produced for any path/query/header parameters included in the OpenAPI document.\n      operationId: generatePostmanCollectionForApiEndpoint\n      parameters:\n        - description: The ID of the Api to generate a Postman collection for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate a Postman collection for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n        - description: The ID of the ApiEndpoint to generate a Postman collection for.\n          in: path\n          name: apiEndpointID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/octet-stream:\n              schema:\n                format: binary\n                title: PostmanCollection\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - ApiEndpoints\n  /v1/apis/{apiID}/version/{versionID}/generate/openapi:\n    get:\n      summary: Generate an OpenAPI specification for a particular Api.\n      description: |-\n        This endpoint will generate any missing operations in any registered OpenAPI document if the operation does not already exist in the document.\n        Returns the original document and the newly generated document allowing a diff to be performed to see what has changed.\n      operationId: generateOpenApiSpec\n      parameters:\n        - description: The ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate an OpenAPI specification for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/GenerateOpenApiSpecDiff\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/version/{versionID}/generate/postman:\n    get:\n      summary: Generate a Postman collection for a particular Api.\n      description: |-\n        Generates a postman collection containing all endpoints for a particular API. Includes variables produced for any path/query/header parameters included in the OpenAPI document.\n      operationId: generatePostmanCollection\n      parameters:\n        - description: The ID of the Api to generate a Postman collection for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to generate a Postman collection for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/octet-stream:\n              schema:\n                format: binary\n                title: PostmanCollection\n                type: string\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Apis\n  /v1/apis/{apiID}/version/{versionID}/metadata:\n    get:\n      summary: Get all metadata for a particular apiID and versionID.\n      operationId: getVersionMetadata\n      parameters:\n        - description: The ID of the Api to retrieve metadata for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to retrieve metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                title: VersionMetadata\n                items:\n                  $ref: \"#/components/schemas/VersionMetadata\"\n                type: array\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Metadata\n    post:\n      summary: Insert metadata for a particular apiID and versionID.\n      operationId: insertVersionMetadata\n      parameters:\n        - description: The ID of the Api to insert metadata for.\n          in: path\n          name: apiID\n          required: true\n          schema:\n            type: string\n        - description: The version ID of the Api to insert metadata for.\n          in: path\n          name: versionID\n          required: true\n          schema:\n            type: string\n      requestBody:\n        description: A JSON representation of the metadata to insert.\n        content:\n          application/json:\n            schema:\n              $ref: \"#/components/schemas/VersionMetadata\"\n        required: true\n      responses:\n        \"200\":\n          content:\n            application/json:\n              schema:\n                $ref: \"#/components/schemas/VersionMetadata\"\n          description: OK\n        default:\n          $ref: \"#/components/responses/default\"\n      tags:\n        - Metadata\n  /v1/apis/{apiI
